// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login'; // Asegúrate de que la ruta sea correcta
import Home from './pages/Home';   // Asegúrate de que la ruta sea correcta
import DashboardLayout from './components/DashboardLayout'; // Asegúrate de la ruta correcta

const App = () => {
  return (
    <Router>
      <Routes>

        <Route path="/dashboard" component={DashboardLayout} />

        {/* Ruta para el componente de inicio de sesión */}
        <Route path="/" element={<Login />} />

        {/* Ruta para el componente de la página Home */}
        <Route path="/Home" element={<Home />} />


      </Routes>
    </Router>
  );
};

export default App;
